import React from "react";
import ReactDom from "react-dom";
import App from "./App";
import carddetail from "./Array"
ReactDom.render(
    <>
    {carddetail.map(function(value){
        return(
            <App key={value.id} imsrc={value.imgsrc} name={value.name}/>
        )
    })}
    </>
    ,document.getElementById("root")
)
